import NavBar from './Navbar'
import Head from 'next/head'

const Layout = (props) => {
    return <div id="layout-div">
        <Head>
            <title>hey</title>
            <link rel="stylesheet" href="https://bootswatch.com/4/minty/bootstrap.min.css" />
        </Head>
        <NavBar />
        {props.children}
        <style jsx>{`
            #layout-div {
                margin: 50px;
            }
        `}</style>
    </div>
}

export default Layout
